    { name: 'moreThan1000', label: 'Salary more $1000' },
  ];
  const buttons = buttonsData.map(({name, label}))
    return (
      <div className='btn-group'>
        <button className='btn btn-light' type='button'>
          All Employees
        </button>
        <button className='btn btn-outline-light' type='button'>
          Promouted
        </button>
        <button className='btn btn-outline-light' type='button'>
          Salary more $1000
        </button>
      </div>
    );
}

